import React from 'react';

function Content() {
  return (
    <div className="content">
      <h2>Películas y series</h2>
      <p>Disfruta de Netflix en tu smart TV, PlayStation, Xbox, Chromecast, Apple TV, reproductor de Blu-ray y más.</p>
    </div>
  );
}

export default Content;
